import React, { Component } from 'react'

export class Results extends Component {
    state = {
        books : []
    };



    bookData = () => {
        let items = this.state.books.items;

        items.map(book => {
            return(
                <div>
                    <p>{book.volumeInfo}</p>
                </div>
            )
        });
        // console.log(items.map(book => console.log(book.volumeInfo.title)));
    }

    componentDidMount() {
    console.log(this);
        fetch('https://www.googleapis.com/books/v1/volumes?q={henry}')
            .then(res => res.json())
            .then(books => this.setState({books}))
            .then(this.bookData);
    }



    render() {

        return <ul>{}</ul>;

    }
}

export default Results
